// @flow
import React from 'react';
import { Row, Col, Card, CardBody } from 'reactstrap';
import { Map, Marker, GoogleApiWrapper } from 'google-maps-react';

import PageTitle from '../../../components/PageTitle';

const BasicMap = props => {
    return (
        <Card>
            <CardBody>
                <h4 className="header-title mb-3">Basic Google Map</h4>

                <div className="gmaps">
                    <Map
                        google={props.google}
                        zoom={14}
                        initialCenter={{ lat: 37.5398126, lng: 71.5893798 }}
                        style={{ width: '100%', height: '100%', position: 'relative' }}></Map>
                </div>
            </CardBody>
        </Card>
    );
};



const GoogleMaps = props => {
    return (
        <React.Fragment>
            <PageTitle
                breadCrumbItems={[
                    { label: 'Maps', path: '/features/googlemaps' },
                    { label: 'Google Maps', path: '/features/googlemaps', active: true },
                ]}
                title={'Google Maps'}
            />

            <Row>
                <Col lg={6}>
                    <BasicMap google={props.google} />
                </Col>
            </Row>
        </React.Fragment>
    );
};

export default GoogleApiWrapper({
    apiKey: 'AIzaSyDsucrEdmswqYrw0f6ej3bf4M4suDeRgNA',
})(GoogleMaps);
